function Home() {
  return (
    <div className="home-container">
      <h1>Bem-vindo ao QuizQuest</h1>
      <div className="buttons-container">
        <Link to="/register" className="btn btn-primary">Registar</Link>
        <Link to="/login" className="btn btn-secondary">Login</Link>
      </div>
    </div>
  );
}

export default Home;
